INSERT INTO `energy_info` VALUES (1,'Rainwater Tank','rainwater_tank_yes','<p>This house has <b>Rain water tank</b></p><p>Harvesting rainwater in a tank gives you a personal supply of water to use during water restrictions and can help to reduce your water bills by 40%.</p>'),(2,'Rainwater Tank','rainwater_tank_no','<p>This house doesn\'t have <b>Rain water tank</b></p><p>But harvesting rainwater in a tank gives you a personal supply of water to use during water restrictions and can help to reduce your water bills by 40%.</p>'),(3,'Solar water Heaters ','solar_water_heaters_no','<p>This house has no<b>Solar Water Heaters</b></p><p>But using solar water heaters reduces your energy consumption by 40%</p>'),(4,'Solar water Heaters ','solar_water_heaters_yes ','<p>This house has <b>Solar Water Heaters</b></p><p>Using solar water heaters reduces your energy consumption by 40%</p>'),(5,'Active','active','<p> This house uses <b> Active Solar Water Heaters </b> </p><p>Very energy efficient than the other type of solar water heater</p>'),(6,'Passive','passive','<p> This house uses <b> Passive Solar Water Heaters </b> </p><p>Not energy efficient though more reliable and may last longer than the other type of solar water heater.</p>'),(7,'Window Operation ','window_operation ','<p>It is important how <b>Windows Operate</b>, because lower air leakage rates will improve your home\'s energy efficiency</p>'),(8,'Awing','awing','<p>This house has <b>Awing</b> window operation method</p><p>This method have lower air leakage rates, which will improve your home\'s energy efficiency</p>'),(9,'Casement','casement','<p>This house has <b>Casement</b> window operation method</p><p>This method have lower air leakage rates than sliding windows, which will improve your home\'s energy efficiency</p>'),(10,'Fixed','fixed','<p>This house has <b>Fixed</b> window operation method</p><p>This method improves home’s energy efficiency but not suitable in places where window ventilation is desired</p>'),(11,'Hopper ','hopper ','<p>This house has <b>Hopper</b> window operation method</p><p>This method have lower air leakage rates than sliding windows, which will improve your home\'s energy efficiency</p>'),(12,'Single and double hung','single_and_double_hung','<p>This house has <b>Single and double hung</b> window operation method</p><p>This method have higher air leakage rates than projecting or hinged windows and less energy efficient</p>'),(13,'Single and double sliding ','single_and_double_sliding ','<p>This house has <b>Single and double sliding</b> window operation method</p><p>This method have higher air leakage rates than projecting or hinged windows and less energy efficient</p>'),(14,'Window Frame ','window_frame ','<p>Improving the thermal resistance of the<b> Window frame</b> can contribute to a window\'s overall energy efficiency</p>'),(15,'Aluminium frame ','aluminium','<p>This house has <b>aluminium frames.</b> This frames are very strong, light, and almost maintenance free but they conduct rapid heat so they are less energy efficient</p>'),(16,'Composite frame','composite','<p>This house has <b>composite frames</b></p><p>This frames are similar to conventional wood frames and they are very energy efficient because they don’t conduct heat</p>'),(17,'Fiberglass frame','fiberglass','<p>This house has <b>Fiberglass frames</b></p><p>This frames are superior thermal performance compared to wood frame and they more energy efficient</p>'),(18,'Vinyl frame','vinyl','<p>This house has <b>Vinyl frames</b></p><p>This frames are superior thermal performance compared to wood frame and they more energy efficient</p>'),(19,'Wood frame','wood','<p>This house has <b>Wood frames</b></p><p>This frame requires regular maintenance but more energy efficient than aluminium frame</p>'),(20,'Window Glazing','window_glazing','<p><b>Glazing or glass type</b> will contribute to your home\'s energy efficiency by improving the thermal resistance</p>'),(21,'Gas Fills','gas_fills','<p>This house uses<b>Gas Fills</b></p><p>This glass/glazing has a higher resistance to heat flow than air hence it is more energy efficient</p>'),(22,'Heat absorbing tints','heat_absorbing_tints','<p>This house uses<b>Heat absorbing tints.</b> This glass reduces solar heat gain and glare, hence it is more energy efficient</p>'),(23,'Insulated','insulated','<p>This house uses<b>Insulated/Double Glazing </b></p><p>This glazing lowers the solar heat gain and lowers the solar heat flow so more energy-efficient</p>'),(24,'Low emissivity coating ','low_emissivity_coating ','<p>This house uses<b>Low emissivity coating.</b> Windows manufactured with low-e coatings typically cost about 10% to 15% more than regular windows, but they reduce energy loss by as much as 30% to 50%</p>'),(25,'Reflective coatings ','reflective_coatings ','<p>This house uses<b>Reflective coatings.</b> This glass/glazing reduce the transmission of solar radiation, blocking more light than heat so they are less energy efficient</p>'),(26,'Spectrally selective coating ','spectrally_selective_coating ','<p>This house uses<b>Spectrally selective coating  </b></p><p>This glass/glazing reduces 40% to 70% of the heat and allows full amount of light to pass through so more energy efficient</p>'),(27,'Energy Saver System','energy_saver_system_yes','<p>This house has <b>Energy Saver System.</b> Helps to generate electricity at your home, which reduces your electricity bill</p>'),(28,'Energy Saver System','energy_saver_system_no','<p>This house doesn\'t have <b>Energy Saver System.</b> But it would help to generate electricity at your home, which reduces your electricity bill</p>'),(29,'Small wind electric system','small_wind_electric_system','<p>This house has <b>Small wind electric system </b></p><p>This type of energy savers system lowers your electricity bills by 50%–90% in winter and also helps uninterruptible power supplies</p>'),(30,'Small solar electric system ','small_solar_electric_system ','<p>This house has <b>Small solar electric system </b></p><p>This type of energy saver system helps uninterruptible power supplies and also reduce the cost of electricity bills in summer</p>'),(31,'Hybrid power system ','hybrid_power_system ','<p>This house has <b>Hybrid power system </b></p><p>This type of energy savers system combines both small wind and solar electric system, and very efficient in summer and winter seasons as well</p>'),(32,'Air Conditioner','air_conditioner_yes','<p>This house has <b>Air Conditioner.</b> Air conditioner helps to improve thermal comfort and indoor air quality in hot and humid climatic regions</p>'),(33,'Air Conditioner','air_conditioner_no','<p>This house doesn\'t have <b>Air Conditioner.</b> But air conditioner would help to improve thermal comfort and indoor air quality in hot and humid climatic regions</p>'),(34,'Central Air Conditioner ','central_air_conditioner ','<p>This house has <b>Central Air Conditioner.</b> This kind of air conditioner is convenient to operate and more efficient than window units</p>'),(35,'Room Air conditioner ','room_air_conditioner ','<p>This house has <b>Room Air Conditioner.</b> These kind of air conditioners, if not installed properly, air leakage will be more and it will be less energy efficient</p>'),(36,'Ductless split air conditioner ','ductless_split_air_conditioner ','<p>This house has <b>Ductless split air conditioner </b></p><p>This kind of air-conditioner provide cooling as well as heating and avoids energy loss so they are highly energy efficient it also works in all climatic zones</p>  '),(37,'Thermostats','thermostats_yes','<p>This house has <b> Thermostats</b></p><p>You can save money on your heating and cooling bills by simply resetting your thermostat when you are asleep or away from home</p>'),(38,'Thermostats','thermostats_no','<p>This house doesn\'t have <b> Thermostats</b></p><p>If you have thermostats you can save money on your heating and cooling bills by simply resetting your thermostat when you are asleep or away from home</p>'),(39,'Skylight','skylight_yes','<p>This house has <b>Skylights.</b> Skylights can make a major contribution to energy efficiency and comfort as they allows more natural light than vertical window</p>'),(40,'Skylight','skylight_no','<p>This house doesn\'t have <b>Skylight.</b> Skylights can make a major contribution to energy efficiency and comfort as they allows more natural light than vertical window</p>'),(41,'External Shading ','external_shading_yes','<p>This house has<b> External Shading</b><p/><p>Effective shading can block up to 90% of solar heat which helps in increase energy efficiency</p>'),(42,'External Shading ','external_shading_no','<p>This house doesn\'t has<b> External Shading</b><p/><p>Effective shading can block up to 90% of solar heat which helps in increase energy efficiency</p>'),(43,'Evergreen Plants ','evergreen_plants ','<p>This house has <b>Evergreen Plants</b></p><p>This kind of shading is recommended for hot humid and some hot dry climates to reduce unwanted glare and heat gain</p>'),(44,'Deciduous Vines','deciduous_vines','<p>This house has <b>Deciduous Plants</b></p><p>This kind of shading is recommended for all climatic regions to reduce unwanted glare and heat gain</p>'),(45,'Eaves','eaves','<p>This house has <b>Eaves</b></p><p>This allows the solar light access inside the house throughout the year, without requiring any user effort</p>'),(46,'Awnings','awnings','<p>This house has <b>Awnings</b></p><p>Using awnings prevents solar heat and keeps the temperatures inside house cooler and it saves air-conditioning cost</p>'),(47,'House Inspected','house_inspected_yes','<p>This house has been inspected by <b>Credible Assessor</b></p> <p>An assessment by a NatHERS accredited assessor results in more environmentally friendly houses that consume less energy to heat and cool</p>'),(48,'House Inspected','house_inspected_no','<p>This house hasn\'t been inspected by <b>Credible Assessor</b></p> <p>An assessment by a NatHERS accredited assessor results in more environmentally friendly houses that consume less energy to heat and cool</p>'),(49,'Electric Heaters','electric_heaters_yes','<p>This house has <b>Electric Heaters</b><p><p>Electric Heaters helps to improve thermal comfort and indoor air quality in cold climatic regions</p>'),(50,'Electric Heaters','electric_heaters_no','<p>This house doesn\'t have <b>Electric Heaters</b><p><p>Electric Heaters helps to improve thermal comfort and indoor air quality in cold climatic regions</p>'),(51,'Central Heating ','central_heating ','<p>This house has <b>Central Heating</b></p><p>Central heating usually uses more energy than space heating as more of the house tends to be heated and it also have high energy losses from ducts<p>'),(52,'Space Heating ','space_heating ','<p>This house has <b>Space Heating</b></p><p>Space heating usually reduces the running cost and the greenhouse emissions</p>');
/*!40000 ALTER TABLE `energy_info` ENABLE KEYS */;
