INSERT INTO `wp_posts` VALUES (1,1,'2015-08-20 05:34:03','2015-08-20 05:34:03','Swimming pools and spas are great for cooling off on a summer\'s day. They\'re also big energy and water guzzlers. In fact, for a typical home, maintaining an in-ground pool can account for up to 30 per cent of a household\'s energy bills and a pool pump can be the largest user of electricity in a home.\r\n\r\nThe main use of energy is for pumping water through the filter to keep your pool water clean and safe. Heating your pool, cleaning appliances, pool lights and chlorine or saltwater sanitation treatment systems all require additional energy.\r\n\r\n<strong>Simple ways to reduce the energy consumption and costs </strong>\r\n<ul>\r\n	<li><strong>Choosing the right pool or spa pump</strong></li>\r\n</ul>\r\nIn a pool or spa, the pump is the biggest user of electricity. Choosing the right pool pump will save you money and maintain pool hygiene. Choosing a bigger pump is not always a better option. Instead install the lowest wattage pump possible for your pool. Multi-speed and variable-speed pumps are often more efficient and use less energy than single-speed pumps as they can operate at a lower speed for filtration and a higher speed for pool cleaning equipment.\r\n<ul>\r\n	<li><strong>Using your pool or spa pump efficiently</strong></li>\r\n</ul>\r\nOnce you have the right pool pump for your needs, minimise energy use by not running it unnecessarily. A timer is very useful for managing your pump\'s run-time and for saving energy. The type of filter you use in conjunction with your pump will also impact on your energy costs.\r\n<ul>\r\n	<li><strong>Using and maintaining your pool and spa</strong></li>\r\n</ul>\r\nBy making sure your pool or spa is well maintained you\'ll be able to keep your pool and spa crystal clear and your energy costs down. For example, by minimising evaporation you can save water and reduce the need for heating. A good quality, well-fitting pool cover or blanket, and if you live in high humidity area a shade cloth, can help reduce evaporation. Even you can choose energy efficient light for the pooling areas.\r\n\r\nTo conclude, energy efficiency of swimming pool and spa can be increased by making smart purchasing decisions, using your pool or spa pump efficiently, maximise your pool and spa pump\'s performance and minimise wastage, keep your pool and spa clean and functioning well for less by following all the above methods one can easily reduce the running cost of the swimming pool and as well as spa.','All you need to know about your swimming pool pumps','','publish','open','open','','hello-world','','','2015-09-08 01:09:08','2015-09-08 01:09:08','',0,'http://localhost:8888/?p=1',0,'post','',0),(2,1,'2015-08-20 05:34:03','2015-08-20 05:34:03','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost:8888/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','open','open','','sample-page','','','2015-08-20 08:46:40','2015-08-20 08:46:40','',0,'http://localhost:8888/?page_id=2',0,'page','',0),(5,1,'2015-08-20 08:46:40','2015-08-20 08:46:40','This is an example