11,'http://localhost:8888/?post_type=_pods_field&amp;p=20',4,'_pods_field','',0),(21,1,'2015-08-20 09:18:45','2015-08-20 09:18:45','Vivek Bhusal is the an MIT student at Monash University.','Vivek Bhusal','','publish','closed','closed','','vivek-bhusal','','','2015-09-08 02:27:51','2015-09-08 02:27:51','',0,'http://localhost:8888/?post_type=team_profile&#038;p=21',0,'team_profile','',0),(22,1,'2015-08-20 09:20:12','2015-08-20 09:20:12','Rachel is MBIS student at Monash University','Rachel','','publish','closed','closed','','rachel','','','2015-09-08 02:51:49','2015-09-08 02:51:49','',0,'http://localhost:8888/?post_type=team_profile&#038;p=22',0,'team_profile','',0),(23,1,'2015-08-20 09:21:12','2015-08-20 09:21:12','Mingda is MBIS student at Monash University','Mingda Cao','','publish','closed','closed','','mingda-cao','','','2015-09-08 02:37:09','2015-09-08 02:37:09','',0,'http://localhost:8888/?post_type=team_profile&#038;p=23',0,'team_profile','',0),(31,1,'2015-08-20 10:27:49','2015-08-20 10:27:49','Pugal is a MBIS student at Monash University','Pugal','','publish','closed','closed','','pugal','','','2015-09-08 02:38:00','2015-09-08 02:38:00','',0,'http://localhost:8888/?post_type=team_profile&#038;p=31',0,'team_profile','',0),(32,1,'2015-08-22 09:36:04','2015-08-22 09:36:04','Every building material comes with an environmental cost of some sort. However, some principles can help guide your choice of sustainable materials and construction systems. Careful analysis and selection of materials and the way they are combined can yield significant improvements in the comfort and cost effectiveness of your home, and greatly reduce its life cycle environmental impact.\r\n\r\nThe first step in any strategy to use sustainable materials is to reduce the demand for new materials. Rather than knocking down and rebuilding a home, it’s worth trying where possible to renovate or at least reuse materials from the existing home. Consider building smaller, well-designed houses and minimising wastage by using prefabricated or modular elements. During design and construction, incorporate approaches that will make it easier to adapt, reuse and eventually dismantle the building. By choosing durable, low maintenance materials, you can minimise the need for new materials and finishes over the building’s lifetime.\r\n\r\nThe next step is to select materials with low environmental impact. Put simply, a ‘sustainable’ material is one that does not impact negatively on non-renewable resources, the natural environment or human health. Most products have a net-negative impact on the environment; however, it’s important to minimise the negative impacts of any materials you choose. When looking at the environmental impact of a material or product, consider all stages of the life cycle that are the upstream stage, the in-use or operational stage, and the downstream stage.\r\n\r\nInformed decisions about materials and construction systems can significantly reduce the environmental impact of a home without adding to the cost.','Choose building materials wisely','','publish','open','open','','energy-saving','','','2015-09-08 01:09:03','2015-09-08 01:09:03','',0,'http://localhost:8888/?p=32',0,'post','',1),(33,1,'2015-08-22 09:36:04','2015-08-22 09:36:04','Lorem ipsum dolor sit amet, sumo conceptam definiebas sed id, ad vix legere detracto, ne vim ullum commune. Te his assum scriptorem. Dolorem instructior his id, at fugit ubique est, in justo oporteat conceptam sit. Ex velit eripuit senserit quo, id mel alii feugiat.\r\n\r\nCum an choro intellegebat. Natum populo signiferumque ut nec. Est veri malorum ullamcorper ad, ea eum copiosae percipit salutatus, id idque reprimique nam. Tempor ignota adipisci id pro, iusto civibus ea sea.\r\n\r\nAgam simul usu te. Possim mnesarchum vel in, te debet movet ignota vix. Ius ex legimus dolores disputando, quodsi adipiscing repudiandae est ad. Minim laudem animal usu eu, erant definitionem ea qui, possim voluptatibus quo et.\r\