\r\n<b>[map]</b>\r\n\r\nFor emergency contact:\r\n\r\nMingda Cao\r\n+61 411 823 825','Contact Us','','inherit','closed','closed','','46-revision-v1','','','2015-08-24 07:46:39','2015-08-24 07:46:39','',46,'http://localhost:8888/?p=55',0,'revision','',0),(56,1,'2015-08-24 07:47:18','2015-08-24 07:47:18','[contact-form-7 id=\"45\" title=\"Contact us\"]\r\n\r\nFor emergency contact:\r\n\r\nMingda Cao\r\n+61 411 823 825','Contact Us','','inherit','closed','closed','','46-revision-v1','','','2015-08-24 07:47:18','2015-08-24 07:47:18','',46,'http://localhost:8888/?p=56',0,'revision','',0),(57,1,'2015-08-24 07:51:43','2015-08-24 07:51:43','[contact-form-7 id=\"45\" title=\"Contact us\"]\r\n\r\nFor emergency contact:\r\n\r\n[Simple Maps]\r\n\r\nMingda Cao\r\n+61 411 823 825','Contact Us','','inherit','closed','closed','','46-revision-v1','','','2015-08-24 07:51:43','2015-08-24 07:51:43','',46,'http://localhost:8888/?p=57',0,'revision','',0),(58,1,'2015-08-24 07:57:18','2015-08-24 07:57:18','[contact-form-7 id=\"45\" title=\"Contact us\"]\r\n\r\nFor emergency contact:\r\n\r\nMingda Cao\r\n+61 411 823 825','Contact Us','','inherit','closed','closed','','46-revision-v1','','','2015-08-24 07:57:18','2015-08-24 07:57:18','',46,'http://localhost:8888/?p=58',0,'revision','',0),(59,1,'2015-08-25 03:09:36','2015-08-25 03:09:36','In future scope of our project can be increased if the amount of project time is increased. If it is done so our website would display more information about the neighbourhood. Information like distance and number of nearest supermarkets and community parks, speed limits of various roads in the locality, distance to public transports like train stations, bus and tram stops, directions and distance to recreation activity centres in and around the community.\r\n\r\nIn future we can also compare all the above information of two or more communities and provide the compared analysed information to the property buyers/renters to help them in making better decision in order to buy/rent a property in the communities they are interested in.\r\n\r\nA subscribe option can be provided to the patrons of our website so that they can get specific time period newsletters/notifications. This newsletters would carry useful and necessary information about events, festivals, fairs and/or carnivals which would take place in and around their community.\r\n\r\nWith regarding to the rating of the house, we can tie-up with an assessor who has received NatHERS* accreditation from a relevant organisation like Association of Building Sustainability Assessors (ABSA) and Building Designers Association of Victoria (BDAV) to provide a credible rating.\r\n\r\n&nbsp;\r\n\r\n*Note: - Nationwide House Energy Rating Scheme (NatHERS) is a framework which supports the efforts of Australian governments to reduce the energy and greenhouse gas impact of residential buildings.','Future','','inherit','closed','closed','','52-revision-v1','','','2015-08-25 03:09:36','2015-08-25 03:09:36','',52,'http://localhost:9005/?p=59',0,'revision','',0),(60,1,'2015-08-25 03:10:37','2015-08-25 03:10:37','Swimming pools and spas are great for cooling off on a summer\'s day. They\'re also big energy and water guzzlers. In fact, for a typical home, maintaining an in-ground pool can account for up to 30 per cent of a household\'s energy bills and a pool pump can be the largest user of electricity in a home.\r\n\r\nThe main use of energy is for pumping water through the filter to keep your pool water clean and safe. Heating your pool, cleaning appliances, pool lights and chlorine or saltwater sanitation treatment systems all require additional energy.\r\n\r\n<strong>Simple ways to reduce the energy consumption and costs </strong>\r\n<ul>\r\n	<li><strong>Choosing the right pool or spa pump</strong></li>\r\n</ul>\r\nIn a pool or spa, the pump is the biggest user of electricity. Choosing the right pool pump will save you money and maintain pool hygiene. Choosing a bigger pump is not always a better option. Instead install the lowest wattage pump possible for your pool. Multi-speed and variable-speed pumps are often more efficient and use less energy than single-speed pumps as they can operate at a lower speed for filtration and a higher speed for pool cleaning equipment.\r\n<ul>\r\n	<li><strong>Using your pool or spa pump efficiently</strong></li>\r\n</ul>\r\nOnce you have the right pool pump for your needs, minimise energy use by not running it unnecessarily. A timer is very useful for managing your pump\'s run-time and for saving energy. The type of filter you use in conjunction with your pump will also impact on your energy costs.\r\n<ul>\r\n	<li><strong>Using and maintaining your pool and spa</strong></li>\r\n</ul>\r\nBy making sure your pool or spa is well maintained you\'ll be able to keep your pool and spa crystal clear and your energy costs down. For example, by minimising evaporation you can save water and reduce the need for heating. A good quality, well-fitting pool cover or blanket, and if you live in high humidity area a shade cloth, can help reduce evaporation. Even you can choose energy efficient light for the pooling areas.\r\n\r\nTo conclude, energy efficiency of swimming pool and spa can be increased by making smart purchasing decisions, using your pool or spa pump efficiently, maximise your pool and spa pump\'s performance and minimise wastage, keep your pool and spa clean and functioning well for less by following all the above methods one can easily reduce the running cost of the swimming pool and as well as spa.','All you need to know about your swimming pool pumps','','inherit','closed','closed','','1-revision-v1','','','2015-08-25 03:10:37','2015-08-25 03:10:37','',1,'http://localhost:9005/?p=60',0,'revision','',0),(61,1,'2015-08-25 03:11:15','2015-08-25 03:11:15','Every building material comes with an environmental cost of some sort. However, some principles can help guide your choice of sustainable materials and construction systems. Careful analysis and selection of materials and the way they are combined can yield significant improvements in the comfort and cost effectiveness of your home, and greatly reduce its life cycle environmental impact.\r\n\r\nThe first step in any strategy to use sustainable materials is to reduce the demand for new materials. Rather than knocking down and rebuilding a home, it’s worth trying where possible to renovate or at least reuse materials from the existing home. Consider building smaller, well-designed houses and minimising wastage by using prefabricated or modular elements. During design and construction, incorporate approaches that will make it easier to adapt, reuse and eventually dismantle the building. By choosing durable, low maintenance materials, you can minimise the need for new materials and finishes over the building’s lifetime.\r\n\r\nThe next step is to select materials with low environmental impact. Put simply, a ‘sustainable’ material is one that does not impact negatively on non-renewable resources, the natural environment or human health. Most products have a net-negative impact on the environment; however, it’s important to minimise the negative impacts of any materials you choose. When looking at the environmental impact of a material or product, consider all stages of the life cycle that are the upstream stage, the in-use or operational stage, and the downstream stage.\r\n\r\nInformed decisions about materials and construction systems can significantly reduce the environmental impact of a home without adding to the cost.','Choose building materials wisely','','inherit','closed','closed','','32-revision-v1','','','2015-08-25 03:11:15','2015-08-25 03:11:15','',32,'http://localhost:9005/?p=61',0,'revision','',0),(63,1,'2015-08-29 06:19:38','2015-08-29 06:19:38','','How will tree impact the energy efficiency','','trash','open','open','','how-will-tree-impact-the-energy-efficiency','','','2015-08-29 06:21:50','2015-08-29 06:21:50